class Solution(object):
    def longestAlternatingSubarray(self, nums, threshold):
        """
        :type nums: List[int]
        :type threshold: int
        :rtype: int
        """
        max_length = 0
        length = 0

        for i in range(len(nums)):
            if nums[i] <= threshold:
                if i == 0 or nums[i] % 2 != nums[i - 1] % 2:
                    length += 1
                else:
                    length = 1
                if nums[i] % 2 == 0:
                    max_length = max(max_length, length)

        return max_length

