class Solution(object):
    def countBeautifulPairs(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        count = 0
        freq = {}

        for num in nums:
            freq[num] = freq.get(num, 0) + 1

        for num in nums:
            if freq[num] > 0:
                count += freq[num] - 1
                freq[num] = 0

        if count < len(nums):
            count += 1

        return count
