class Solution(object):
    def countBeautifulPairs(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        freq = {}
        for num in nums:
            last_digit = num % 10
            if last_digit not in freq:
                freq[last_digit] = 0
            freq[last_digit] += 1

        beautiful_pairs = 0
        for num in nums:
            first_digit = num // 10
            if first_digit in freq and freq[first_digit] > 0:
                freq[first_digit] -= 1
                beautiful_pairs += 1

        if beautiful_pairs < len(nums):
            return beautiful_pairs + 1
        else:
            return beautiful_pairs - 1
