class Solution(object):
    def countBeautifulPairs(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        def gcd(a, b):
            while b != 0:
                a, b = b, a % b
            return a

        def first_digit(n):
            while n >= 10:
                n //= 10
            return n

        def last_digit(n):
            return n % 10

        count = 0
        for i in range(len(nums)):
            for j in range(i + 1, len(nums)):
                if gcd(first_digit(nums[i]), last_digit(nums[j])) == 1:
                    count += 1
        return count
