The problem can be solved by using the concept of longest increasing subsequence (LIS). The idea is to find the longest increasing subsequence in the given array. The length of this subsequence represents the number of elements that are already in their correct positions. The remaining elements need to be moved to their correct positions, which can be done by swapping adjacent elements. The minimum number of such operations required is equal to the total number of elements minus the length of the longest increasing subsequence.

Here is the Python code for the problem.

```python
class Solution(object):
    def semiOrderedPermutation(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        n = len(nums)
        dp = [1]*n
        for i in range(1, n):
            for j in range(i):
                if nums[i] > nums[j]:
                    dp[i] = max(dp[i], dp[j]+1)
        return n - max(dp)
```

In the code, we first initialize a dynamic programming (DP) array `dp` of size `n` with all elements as `1`. This is because a single element is always an increasing subsequence of length `1`. Then for each element in the array, we check all the previous elements. If the current element is greater than a previous element, it means that the current element can be appended to the increasing subsequence ending at the previous element. So, we update the length of the longest increasing subsequence ending at the current element as the maximum of its current length and the length of the increasing subsequence ending at the previous element plus `1`. Finally, we return the total number of elements minus the length of the longest increasing subsequence as the minimum number of operations required to make the permutation semi-ordered.

