class Solution(object):
    def maximizeSum(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        nums.sort(reverse=True)
        for i in range(k):
            if nums[i] < 0:
                nums[i] = -nums[i]
            else:
                break
        return sum(nums) - (k-i)%2*min(nums)*2
