class Solution(object):
    def maxDivScore(self, nums, divisors):
        """
        :type nums: List[int]
        :type divisors: List[int]
        :rtype: int
        """
        max_score = 0
        max_divisor = 0
        for divisor in divisors:
            score = 0
            for num in nums:
                if num % divisor == 0:
                    score += 1
            if score > max_score:
                max_score = score
                max_divisor = divisor
            elif score == max_score:
                max_divisor = min(max_divisor, divisor)
        return max_divisor

