class Solution(object):
    def closetTarget(self, words, target, startIndex):
        """
        :type words: List[str]
        :type target: str
        :type startIndex: int
        :rtype: int
        """
        n = len(words)
        left, right = 0, 0
        for i in range(n):
            if words[(startIndex + i) % n] == target:
                right = i
                break
        for i in range(n):
            if words[(startIndex - i + n) % n] == target:
                left = i
                break
        return min(left, right) if left != 0 or right != 0 else -1

